package Leetcode;
//https://leetcode.com/problems/is-subsequence/submissions/
public class Is_Subsequence {
    static boolean isSubsequence(String s, String t) {
        int idx = 0;
        for(int i = 0; i < t.length() && idx < s.length(); i++) {
            if(t.charAt(i) == s.charAt(idx)) idx++;
        }
        return idx == s.length();

    }
    public static void main(String args[]){
        System.out.println(isSubsequence("abc","ahbgdc"));//t
        System.out.println(isSubsequence("axc","ahbgdc"));//f
        System.out.println(isSubsequence("axc",""));//f
        System.out.println(isSubsequence("aaaaaa","bbaaaa"));//f
        System.out.println(isSubsequence("twn","xxxxxxxxxxxxxxxxxxxxxxxxxxxxxxtxxxxxxxxxxxxxxxxxxxxwxxxxxxxxxxxxxxxxxxxxxxxxxn"));//t
        System.out.println(isSubsequence("","ahbgdc"));//t
        System.out.println(isSubsequence("leeeeetcode",""));//t
        System.out.println(isSubsequence("acb","ahbgdc"));//f
    }
}
